import React from 'react'
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

function Gridpapers(props) {

        return (
        <div>
            <Grid container justify="center" spacing={2}>
            <Grid key={0} item>
                <Paper style={{width:"300px",height:"600px"}}>{props.data}
            </Paper></Grid>
                <Grid key={1} item>
                <Paper style={{width:"300px",height:"600px"}}>{props.data}</Paper></Grid>
                <Grid key={2} item>
                <Paper style={{width:"300px",height:"600px"}}>{props.data}</Paper></Grid>
                {props.selected=='Pricing' ? <div></div> : <Grid key={3} item>
                    
                    <Paper style={{width:"300px",height:"600px"}}>{props.data}</Paper></Grid>
                   }
             </Grid>
        </div>
    )
}

export default Gridpapers
